    private fun jj_rescan_token() {
        jj_rescan = true
        for (i in 0..6) {
            try {
                var p: JJCalls? = jj_2_rtns[i]
                do {
                    if (p!!.gen > jj_gen) {
                        jj_la = p.arg
                        jj_scanpos = p.first
                        jj_lastpos = jj_scanpos
                        when (i) {
                            0 -> jj_3_1()
                            1 -> jj_3_2()
                            2 -> jj_3_3()
                            3 -> jj_3_4()
                            4 -> jj_3_5()
                            5 -> jj_3_6()
                            6 -> jj_3_7()
                        }
                    }
                    p = p.next
                } while (p != null)
            } catch (ls: LookaheadSuccess) {
            }

        }
        jj_rescan = false
    }

    private fun jj_save(index: Int, xla: Int) {
        var p: JJCalls? = jj_2_rtns[index]
        while (p!!.gen > jj_gen) {
            if (p.next == null) {
                p.next = JJCalls()
                p = p.next
                break
            }
            p = p.next
        }
        p.gen = jj_gen + xla - jj_la
        p.first = token
        p.arg = xla
    }

